Mason is the teacher's assistant in charge of detention. She's hot and gets hit on constantly so she decided to at least cash in for all her troubles. She's in the middle of a teasing session when the Dean walks in. He angrily sends the students out and Mason thinks she'll be fired but in fact what the Dean wants is a one-on-one session with her.
